// frontend_v2/src/pages/AuditTrailPage.js
import React, { useState, useEffect, useCallback } from 'react';
import {
  Container,
  Typography,
  Card,
  CardContent,
  CircularProgress,
  Alert,
  Chip,
  Box,
  Grid,
} from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';
import { getAuditLogs } from '../services/api';
import { AccessTime, Person, Info } from '@mui/icons-material';

function AuditTrailPage() {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const fetchLogs = useCallback(async () => {
    try {
      setLoading(true);
      const response = await getAuditLogs();
      setLogs(response.data);
    } catch (err) {
      setError(
        'Failed to fetch audit logs. You may not have permission to view this page.'
      );
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchLogs();
  }, [fetchLogs]);

  const columns = [
    {
      field: 'timestamp',
      headerName: 'Timestamp',
      flex: 1.5,
      renderCell: (params) => (
        <Box display="flex" alignItems="center" gap={1}>
          <AccessTime fontSize="small" color="action" />
          {new Date(params.value).toLocaleString()}
        </Box>
      ),
    },
    {
      field: 'user',
      headerName: 'User',
      flex: 1,
      renderCell: (params) => (
        <Box display="flex" alignItems="center" gap={1}>
          <Person fontSize="small" color="action" />
          {params.value ? params.value.username : 'System'}
        </Box>
      ),
    },
    {
      field: 'action',
      headerName: 'Action',
      flex: 1,
      renderCell: (params) => {
        let color = 'default';
        if (params.value === 'CREATED') color = 'success';
        else if (params.value === 'DELETED') color = 'error';
        return <Chip label={params.value} color={color} size="small" />;
      },
    },
    { field: 'object_repr', headerName: 'Object', flex: 2 },
  ];

  if (loading)
    return (
      <Container sx={{ textAlign: 'center', mt: 5 }}>
        <CircularProgress />
      </Container>
    );

  return (
    <Container sx={{ py: 3 }}>
      <Box mb={3}>
        <Typography variant="h4" component="h1" gutterBottom>
          <Info fontSize="small" sx={{ mr: 1 }} /> Audit Trail
        </Typography>
        <Typography variant="subtitle1" color="text.secondary">
          A log of all significant user actions in the system.
        </Typography>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      <Card sx={{ p: 2 }}>
        <CardContent>
          <div style={{ height: 500, width: '100%' }}>
            <DataGrid
              rows={logs}
              columns={columns}
              pageSize={10}
              rowsPerPageOptions={[10, 25, 50]}
              getRowId={(row) => row.id}
              disableSelectionOnClick
              sx={{
                '& .MuiDataGrid-cell': { outline: 'none' },
                '& .MuiDataGrid-columnHeaders': { backgroundColor: '#f5f5f5' },
              }}
            />
          </div>
        </CardContent>
      </Card>
    </Container>
  );
}

export default AuditTrailPage;
